import React from 'react';
import './Search.css';
import './Home.css';
import search from './Images/search.png';
import { BrowserRouter as Router, Route } from 'react-router-dom';

function Search(){
    return (
        <div>
            <div className="ContainerT">
                <h1 className="Title1"> Search </h1>
            </div>
            <div style={{ paddingLeft: "80px" }}>
                <input className="SearchI" />
                <Link style={{ color: "black", textDecoration: "none" }} to='/search/result'>
                    <img src={search} style={{ verticalAlign: "middle", height: "45px" }} />
                </Link>
            </div>
            <div>
                <Route path="/search/result" component={Result} />
            </div>

        </div>
    );
}

function Result() {
    return (
        <div>
            <h1> j </h1>
            </div>
        )
}

export default Search;
